import React, {Component} from 'react';
import axios from 'axios';


export default class SearchDesc extends Component {

    constructor(props) {
        super(props);
        this.state = {description: []};
        this._isMounted = false;
    }

    componentWillUnmount() {
        this._isMounted = false;
    }

    componentDidMount() {
        this._isMounted = true;
    }

    render() {
        return (
            <section class="formulario mb-5">
                <div style={{ marginTop: 20 }}>
                    <div class="formul">
                        <label class="texto" for="busca">Localizar</label>
                        <textarea class="texto-form" id="busca" rows="5" cols="100"></textarea>
                    </div>


                    <div class="row d-flex align-items-center mb-3 mt-4">
                        <div class="col-md-12">
                            <div class="text-center">
                                <button type="button" class="btn btn-grey btn-rounded z-depth-1a">Buscar</button>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        )
    }
}
